SetTriple: Related topics, topi, Markdown Content, Value { r#type: Text, value: "- **Related topics**, topics connected to the news event. For instance, in the context of US Politics, the news event could be linked to a politician.\n\n- **Avatar**, a square image with a minimum 500px by 500px resolution.\n\n- **Cover,** a banner image with a 3:1 ratio (exact cover size is 1192px by 320px).\n\n- **Location**, the place where the news event takes or took place.\n\n- **Date**, the date when the news event happened.\n\n- **Sources**, encompass press articles, press releases, social media posts, and relevant documents such as transcripts or statements, all of which provide information and facilitate comprehension of current events.\n\n- **Claims about**, to complete, comment, question or refute the news event.\n\n- **Claims from**, key insights derived from the news event, highlighting the pivotal aspects or conclusions.\n\n- **Relevant questions**, the **Five W's and H**: Who? What? When? Where? Why? How?\" is a checklist used in journalism to guide research and interviews and to raise important ethical questions, such as How do you know that?\"\n\n- **Tags**, help in filtering tables and sorting the entity\n\n\n" }
